import './App.css';
import TaskList from './TaskList';

function App() {
    const tasks = [

        { id: 1, figure:<img src={require('./faty.jpg').default}  alt="Figure 1" />, completed: false },
        { id: 2, figure: <img src={require('./flr.jpg').default} alt="Figure 2" />, completed: false },
        { id: 3, figure: <img src={require('./lyt.jpg').default} alt="Figure 3" />, completed: true },
    ];

    return (
    <div>
    <h1>Liste des figures</h1>
    <TaskList tasks={tasks} />
    </div>
    );
}
export default App;
